class App extends Component {
  render(){
    const style = {
      padding: '20px'
    }

  return (
    <div className="App">
    <div className="First">
    <h1>Hello, NEW APP</h1>
    <Card name='Terry'/>
    </div>
    <h1 style={style}></h1>
    <Summary/>
    <h2></h2>
    <Summary2/>
    <h2></h2>
    <Summary/>
    </div>
  );
}
}

export default App;
